import React from "react";
import {ProfileWrapper} from "./ProfileCompoent_style";

interface Props {
    username: string;
    description: string;
}


export const ProfileComponent: React.FC<Props> = (Props) => {

    const array = [1,2,3,4,5,6]

    return(

    <ProfileWrapper>
        <div className="container">
            <div className="card">
                <h2 className="username">Profile Page</h2>
                <p className="description"> Description </p>
                <div className="post-container">
                    <div>{array.map((array: number) => {
                        return <div className="posts">{array}</div>
                    })}</div>
                </div>
            </div>
        </div>
    </ProfileWrapper>

    );
};

export default ProfileComponent;
